INSERT INTO `post_comments` VALUES (1,'出た、おじいちゃんジョーク。僕おじいちゃんジョーク大好き。とても桜綺麗だね。',NULL,1,2,'2020-12-25 01:56:36','2020-12-25 01:56:36'),(2,'ありがとう。これからもユーモアを大切にするよ。最近会ってないけど桜は元気にしてるかな？',1,NULL,2,'2020-12-25 01:58:46','2020-12-25 01:58:46'),(3,'うん元気にしてるよ、中学校から始めた弓道に忙しいみたいだけどとても頑張っているよ！',NULL,1,2,'2020-12-25 02:00:56','2020-12-25 02:00:56'),(4,'それは良かった。孫太郎も風邪を引かないように気をつけるんだよ。コロナ禍が終息したらまた遊びにおいで。',1,NULL,2,'2020-12-25 02:02:55','2020-12-25 02:02:55'),(5,'うん、早く終息してほしいね。また買い物とかあれば言ってね。前みたいに玄関先に置いておくからね。',NULL,1,2,'2020-12-25 02:04:14','2020-12-25 02:04:14'),(6,'ありがとう、また必要であれば言うね。',1,NULL,2,'2020-12-25 02:04:42','2020-12-25 02:04:42'),(7,'おばあちゃんにもよろしく言っておいてね。',NULL,1,2,'2020-12-25 02:05:02','2020-12-25 02:05:02'),(8,'言っておくね。',1,NULL,2,'2020-12-25 02:11:29','2020-12-25 02:11:29'),(9,'僕も行ったことある！綺麗だけど鳥居がとても長いよね。僕も知らずに行ってとても疲れた。今日はゆっくり休んでね。',NULL,1,3,'2020-12-25 02:17:14','2020-12-25 02:17:14'),(10,'ありがとう。ゆっくり休むね。明日はばぁばとディナーをしてきます。場所は結婚式を挙げたバリバリホテルです。',1,NULL,3,'2020-12-25 02:18:33','2020-12-25 02:18:33'),(11,'いいなぁ、僕も美味しいもの食べたい。また次会った時にばぁばとの馴れ初め聞かせてね！そういえばすごく気になってたんだ。',NULL,1,3,'2020-12-25 02:20:12','2020-12-25 02:20:12'),(12,'恥ずかしいなぁ。また覚えてたらね。',1,NULL,3,'2020-12-25 02:20:42','2020-12-25 02:20:42'),(13,'いやいや、これカブトだから！好きだなぁもう。',NULL,1,4,'2020-12-25 02:23:42','2020-12-25 02:23:42'),(14,'渾身のじじギャグ',1,NULL,4,'2020-12-25 02:24:03','2020-12-25 02:24:03'),(15,'面白くないけど好き',NULL,1,4,'2020-12-25 02:24:36','2020-12-25 02:24:36'),(16,'若い！どことなくお父さんに似てるね。',NULL,1,5,'2020-12-25 02:27:51','2020-12-25 02:27:51'),(17,'孫太郎もいずれこんな男前になるよ',1,NULL,5,'2020-12-25 02:28:56','2020-12-25 02:28:56'),(18,'いやいや、男前の部類じゃないよ。この顔は間違いなく3枚目。ギャグ好きなの隠しきれてないよ。写真でわかるふざけ具合。(笑)',NULL,1,5,'2020-12-25 02:30:46','2020-12-25 02:30:46'),(19,'バレちゃったかぁ、孫太郎もおじいちゃんみたいに面白くなるんだよ。',1,NULL,5,'2020-12-25 02:32:14','2020-12-25 02:32:14'),(20,'いや、面白くはない(笑)でも間違いなく僕もおじいちゃんの孫だよ、最近笑かすことが快感になってきてる。(笑)',NULL,1,5,'2020-12-25 02:33:23','2020-12-25 02:33:23'),(21,'ほほほ',1,NULL,5,'2020-12-25 02:33:33','2020-12-25 02:33:33'),(22,'ヒント、名作',1,NULL,6,'2020-12-25 02:35:41','2020-12-25 02:35:41'),(23,'いやいや名作だけじゃわからないよ(笑)ただ一つ言えるのは洋画だね。',NULL,1,6,'2020-12-25 02:36:32','2020-12-25 02:36:32'),(24,'おー、もう半分答えだね。',1,NULL,6,'2020-12-25 02:36:53','2020-12-25 02:36:53'),(25,'ヒント、この写真ではもう無いけどこの建物に時計があったよ',1,NULL,6,'2020-12-25 02:37:46','2020-12-25 02:37:46'),(26,'難しいなぁ、でもとても見覚えがある。',NULL,1,6,'2020-12-25 02:38:22','2020-12-25 02:38:22'),(27,'ヒント、落雷',1,NULL,6,'2020-12-25 02:38:42','2020-12-25 02:38:42'),(28,'あー、わかった！バックトゥーザフューチャーだね！',NULL,1,6,'2020-12-25 02:39:40','2020-12-25 02:39:40'),(29,'惜しい、バック・トゥ・ザ・フューチャーだよ。',1,NULL,6,'2020-12-25 02:40:49','2020-12-25 02:40:49'),(30,'いやいやそこは許して。(笑)おじいちゃんアメリカ行ったことあったんだ！また話聞かせて！！！！！',NULL,1,6,'2020-12-25 02:42:00','2020-12-25 02:42:00'),(31,'仕事でね。また写真いっぱい見せるね。',1,NULL,6,'2020-12-25 02:42:37','2020-12-25 02:42:37'),(32,'トゥース',1,NULL,4,'2020-12-25 02:44:06','2020-12-25 02:44:06'),(33,'かっこいい！ランニングバックだったんだよね！僕も今背番号11だよ！すごい偶然！',NULL,1,7,'2020-12-25 02:48:10','2020-12-25 02:48:10'),(34,'血は争えない、ってねぇー。',1,NULL,7,'2020-12-25 02:49:29','2020-12-25 02:49:29'),(35,'いや、後ろの人全然笑ってないよ(笑)',NULL,1,8,'2020-12-25 02:53:26','2020-12-25 02:53:26'),(36,'これはね、真剣にじぃじの貴重な爆笑ギャグをメモっているんだよ。',1,NULL,8,'2020-12-25 02:54:13','2020-12-25 02:54:13'),(37,'絶対に違う(笑)',NULL,1,8,'2020-12-25 02:54:33','2020-12-25 02:54:33'),(38,'でも一つだけ言えるのはじぃじだけはウケてる',NULL,1,8,'2020-12-25 02:55:32','2020-12-25 02:55:32'),(39,'笑う門には福來る',1,NULL,8,'2020-12-25 02:56:26','2020-12-25 02:56:26'),(40,'いやいや、絶対通販で頼んだでしょこれ(笑)でも美味しそう。今年は会えなかったけど、あけましておめでとう！',NULL,1,9,'2020-12-25 03:01:30','2020-12-25 03:01:30'),(41,'そうだねぇ。やっぱりみんなに会えないとじぃじも寂しいねぇ。',1,NULL,9,'2020-12-25 03:02:23','2020-12-25 03:02:23'),(42,'この状況が終息したら絶対遊びに行くからね！！！！',NULL,1,9,'2020-12-25 03:03:13','2020-12-25 03:03:13'),(43,'しばしの我慢じゃのぉ',1,NULL,9,'2020-12-25 03:03:29','2020-12-25 03:03:29'),(44,'でもばぁばがいるから安心だ',1,NULL,9,'2020-12-25 03:04:14','2020-12-25 03:04:14'),(45,'好きだねぇー(笑)',NULL,1,9,'2020-12-25 03:04:43','2020-12-25 03:04:43'),(46,'そのまんまだね(笑)六甲山牧場かな？',NULL,1,10,'2020-12-25 03:07:55','2020-12-25 03:07:55'),(47,'そうだよ。今日ばぁばと行ってきたよ。バター作りもしてきたよ。美味しかった。羊も可愛かった。',1,NULL,10,'2020-12-25 03:09:01','2020-12-25 03:09:01'),(48,'じいちゃん、動物好きだもんね！',NULL,1,10,'2020-12-25 03:09:28','2020-12-25 03:09:28'),(49,'大好きさ、癒しだぁ',1,NULL,10,'2020-12-25 03:09:45','2020-12-25 03:09:45'),(50,'うわー美味しそう！！また今度僕も連れてってね！！！',NULL,1,11,'2020-12-25 03:13:19','2020-12-25 03:13:19'),(51,'もちろんさ。早く会いたいねぇ。',1,NULL,11,'2020-12-25 03:13:45','2020-12-25 03:13:45'),(53,'うわぁ、とても綺麗だね。なんだか今日の嫌なことを忘れられるよ。',NULL,1,12,'2020-12-25 03:19:20','2020-12-25 03:19:20'),(54,'何かあったのかい？大丈夫かい？いつでも電話してくるんだよ。',1,NULL,12,'2020-12-25 03:20:01','2020-12-25 03:20:01'),(55,'うん、ありがとう。ちょっと部活で喧嘩しちゃっただけだから大丈夫だよ。',NULL,1,12,'2020-12-25 03:21:00','2020-12-25 03:21:00'),(56,'今はお互いイライラしてるだろうけども、それも大事な事だよ。雨降って地固まるってねぇー。',1,NULL,12,'2020-12-25 03:22:06','2020-12-25 03:22:06'),(57,'うん',NULL,1,12,'2020-12-25 03:22:49','2020-12-25 03:22:49'),(58,'うん、きっともうすぐ会えるよ！',NULL,1,11,'2020-12-25 03:25:15','2020-12-25 03:25:15'),(59,'そう願っておる！！！',1,NULL,11,'2020-12-25 03:25:28','2020-12-25 03:25:28');
