INSERT INTO `timelines` VALUES (1,2,'1953年','幼少期','丸岡くんと友達になる','近所の公園で一緒に遊んだ。幼馴染みの丸岡くんとは今でも仲がいい。','初めての友達で嬉しかった。',NULL,'2020-12-24 13:15:37','2020-12-24 13:15:37'),(11,1,'1950年','幼少期','初めてキャラメルを食べた','近所のおじちゃんにお土産でキャラメルをもらった。','今では当たり前だが、当時はとても嬉しかった。',NULL,'2020-12-24 15:44:26','2020-12-24 15:44:26'),(13,1,'1954年','幼少期','市立対辺小学校入学','最寄りの小学校に入学。兄と初めて学校に行った。','とてもワクワクした。初めに友達になった豊田くんとは今でも仲良しである。',NULL,'2020-12-24 15:45:53','2020-12-24 15:45:53'),(14,1,'1956年','幼少期','作品コンクールに入賞した','クルクルプロペラマシーンでユニーク賞をもらった。','嬉しかった。この頃から工作で物を作るのが好きになった。',NULL,'2020-12-24 15:46:44','2020-12-24 15:46:44'),(15,1,'1960年','10代','市立沢樫中学校入学','少し家から離れた中学校に入学した。','帰り道に丸屋さんのコロッケを食べるのが日課だった。',NULL,'2020-12-24 15:47:39','2020-12-24 15:47:39'),(16,1,'1963年','10代','私立穏暖高校入学','受験勉強を頑張った末に入学出来た。剣道部に入るのが目的だった。','何がなんでも強豪校で剣道がしたかった。',NULL,'2020-12-24 15:48:21','2020-12-24 15:48:21'),(17,1,'1966年','10代','私立州五井大学入学','経済学を勉強するために志望した。剣道部に所属した。','昼は勉学、夕方は剣道、休日は悪友と羽目を外して遊んだ。',NULL,'2020-12-24 15:49:30','2020-12-24 15:49:30'),(18,1,'1970年','20代','株式会社貼張商事に入社','就職活動の末、剣道部OBの誘いで商社に入社。','胸を張っていた。社会人として働くことにワクワクしていた。',NULL,'2020-12-24 15:52:22','2020-12-24 15:52:22'),(19,1,'1973年','20代','ばぁばと出会う','友人の豊田くんの友達としてばぁばと出会う。','正直言うとこの時から気になっていた。その2年後に付き合い始める。',NULL,'2020-12-24 15:54:18','2020-12-24 15:54:18'),(20,1,'1976年','20代','結婚する','バリバリプリンスホテルで結婚式を挙げた。','これほどに嬉しいと思うことはなかった。',NULL,'2020-12-24 15:57:54','2020-12-24 15:57:54'),(21,1,'1977年','30代','幸生誕生','息子の幸生が生まれる。','我が子を抱きしめた時の気持ちはとても尊かった。',NULL,'2020-12-24 16:00:19','2020-12-24 16:00:19'),(23,1,'1986年','30代','家を建てる','マイホーム購入','もっと仕事をがんばろうと決意した。',NULL,'2020-12-24 16:05:48','2020-12-24 16:05:48'),(24,1,'1980年','30代','永幸誕生','次男の永幸が生まれる。永く幸せになって欲しいと願いを込めて。','長男の時の感動が再び味わえた。かけがえの無い瞬間だった。',NULL,'2020-12-25 01:32:40','2020-12-25 01:32:40'),(25,1,'2006年','50代','孫太郎誕生','孫太郎が生まれた。目にいれても痛く無いと言う言葉は本当だった。','自分に孫ができたことの喜びを感じることができた。一生愛情を注いであげたい。',NULL,'2020-12-25 01:37:03','2020-12-25 01:37:03'),(26,1,'2008年','60代','桜誕生','桜が生まれた。男ばかりの末家に花が咲いた。','女の子なので幸生や永幸や孫太郎の時とはまた違う感動を味わった。変わらず愛情を注いであげたいと思った。',NULL,'2020-12-25 01:40:03','2020-12-25 01:40:03'),(27,1,'2012年','60代','貼張商事を引退','定年退職で長らく勤めた仕事を引退した。','これまで続けて来られたのも会社の同僚、家族、もっとも妻の幸子の支えがあったからである。感謝している。',NULL,'2020-12-25 01:43:11','2020-12-25 01:43:11'),(28,1,'1982年','30代','初めての海外','出張でアメリカに行った。カリフォルニア','全てが新鮮だった。特に憧れのハリウッドに行けたことが何よりの思い出。','6de1d53340b2bc17cea56ae17a44f3a9bc6fb3959295f3fa79eae3040206','2020-12-25 05:40:29','2020-12-25 05:40:29');
